(7, 'blog', '{\"content\":\"<div class=\\\"col-md-6 fsimg\\\"><img src=\\\"\\/media\\/image_1701840998.jpg\\\" alt=\\\"image_1701840998.jpg\\\" \\/>\\r\\n\\t\\t\\t\\t\\t<img src=\\\"images\\/summary1.png\\\" alt=\\\"\\\" \\/>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<div class=\\\"col-md-6\\\">\\r\\n\\t\\t\\t\\t\\t<h2>Get to Know Elife<\\/h2>\\r\\n\\t\\t\\t\\t\\t<p>Elife started in 2019 as the dream of two friends of creating a platform to give all travelers the fleet that fits their needs. That\\u2019s why we have a wide variety of vehicle options available. If you need a ride cross country or just a private ride service to the airport or your hotel, we have your back! Our fares adapt to your budget, depending on the passengers, the distance and the kind of service. Our charter car service can take you in a day trip car service, a long distance car driving service, a state to state car service and many more, all including driver pick up service to your house, office, airport, hotel or anywhere else you need!<\\/p>\\r\\n\\t\\t\\t\\t\\t<p>By 2025 we want to become the biggest MaaS company in the world, so whenever you hire a car service you can count on us. All our private transportation services have bilingual drivers, waiting times up to 1 hour for airport pick ups, all inclusive rates and many other advantages. One of our core values is flexibility, that\\u2019s why we want you to have available free cancellation up to 24 hours before your ride. If you want a personal long distance driver for hire, you will find the perfect fit for you with us, maybe you need a sedan or a bus, we have everything in between! If you need a private transportation service near you, we got you!<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\",\"files\":\"C:\\\\Users\\\\SEO\\\\AppData\\\\Local\\\\Temp\\\\php160.tmp\"}', 0, '2023-12-05 15:51:25', '2023-12-05 23:36:41'),
(8, 'key_feature', '{\"content\":\"<h5>KEY FEATURES<\\/h5>\\r\\n\\t\\t\\t\\t<h2>Make Your Trip Your Way With Us<\\/h2>\\r\\n\\t\\t\\t\\t<div class=\\\"col-md-3\\\">\\r\\n\\t\\t\\t\\t\\t<span><i class=\\\"bi bi-send-slash\\\"><\\/i><\\/span>\\r\\n\\t\\t\\t\\t\\t<h6>Safety First<\\/h6>\\r\\n\\t\\t\\t\\t\\t<p>Experienced staff and professionally trained chauffeurs<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<div class=\\\"col-md-3\\\">\\r\\n\\t\\t\\t\\t\\t<span><i class=\\\"bi bi-bus-front\\\"><\\/i><\\/span>\\r\\n\\t\\t\\t\\t\\t<h6>Reasonable Rates<\\/h6>\\r\\n\\t\\t\\t\\t\\t<p>We can offer you the right vehicle at the right price to fit your budget<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<div class=\\\"col-md-3\\\">\\r\\n\\t\\t\\t\\t\\t<span><i class=\\\"bi bi-ev-front\\\"><\\/i><\\/span>\\r\\n\\t\\t\\t\\t\\t<h6>Largest Fleet<\\/h6>\\r\\n\\t\\t\\t\\t\\t<p>We offer an extensive fleet of vehicles including sedans, limousines and coach buses<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<div class=\\\"col-md-3\\\">\\r\\n\\t\\t\\t\\t\\t<span><i class=\\\"bi bi-airplane-engines\\\"><\\/i><\\/span>\\r\\n\\t\\t\\t\\t\\t<h6>Nationwide Service<\\/h6>\\r\\n\\t\\t\\t\\t\\t<p>We provide our transportation services nationwide<\\/p>\\r\\n\\t\\t\\t\\t<\\/div>\\r\\n\\t\\t\\t\\t<div class=\\\"mt-5\\\">\\r\\n\\t\\t\\t\\t\\t<a class=\\\"btn btn-outline-warning px-5 py-2\\\" href=\\\"#\\\">About More<\\/a>\\r\\n\\t\\t\\t\\t<\\/div>\"}', 0, '2023-12-05 15:51:56', '2023-12-05 16:06:19'),
